import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom"; // BrowserRouter as Router
import Navigation from "./components/Navigation"; // Navigation component
import Home from "./pages/Home"; // Home page component
import MovieSearch from "./pages/MovieSearch"; // Movie search page component
import "./styles/styles.css"; // Global CSS

function App() {
  return (
    <Router> {/* Wrapping everything inside Router for routing */}
      <Navigation /> {/* Render the Navigation component */}
      <Routes>
        <Route path="/" element={<Home />} /> {/* Home page */}
        <Route path="/search" element={<MovieSearch />} /> {/* Movie search page */}
      </Routes>
    </Router>
  );
}

export default App;
